import React from 'react';
import web from "../src/images/3D-Transparent-PNG.png"
import Common from './Common';

const Home = () => {
    return(
    <>
        <div className="bgimg">
        <Navbar/>
       <Common name="Grow your Business with " sideimg={web} visit="/Service" btname="Get started" />
       </div>
    </>
    )
}

export default Home;
